import React from "react";

//Calendar item
class CalendarItem extends React.Component{
    constructor(props){
        super(props);
    }
render(){
    return(
        <div className="col">
            <div >
            <label >Subject:</label>
            <input type="text" id="NewItemSubject"></input>         
            </div>
            <div>
            <textarea id="NewItemText"></textarea>
            </div>
            <div>
            <label htmlFor="NewItemTime">Time:</label>
            </div>
            <div>
            <input type="time" id ="NewItemTime"></input>
            
            </div>
            <label htmlFor="NewItemDate">Date:</label>
            <input type="date" id ="NewItemDate"></input>
        </div>
    )
}

}
export default CalendarItem;
